__NUXT_JSONP__("/page/6", (function(a,b,c,d,e,f,g,h,i,j,k,l,m,n,o,p,q,r,s,t){return {data:[{works:{contents:[{id:"asayakenoato-web",createdAt:d,updatedAt:"2022-01-09T01:05:00.889Z",publishedAt:d,revisedAt:d,title:"asayake no ato \u002F WEB SITE",category:[],release:l,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F1a4cb841a956467ba47c4b89d9ef4c57\u002Fasayake_hp_b-800x500.jpg",height:m,width:n},overview:"京都出身4Pロックバンドasayake no atoさんのウェブサイトの制作、アーティスト写真の撮影をさせていただきました。\n\nasayake no atoさんの音から受ける「情景」をキーワードにシンプルなタイポグラフィーに朝焼けのイメージと幾何学模様を組み合わせたモーショングラフィックをデザインに取り入れました。クリーンでスタイリッシュなデザインに仕上がりました。\n\nスマホ・タブレットに対応したレスポンシブWebデザインで構築しました。"},{id:"daydream-ponzu",createdAt:o,updatedAt:"2022-01-09T01:05:04.656Z",publishedAt:o,revisedAt:"2022-01-09T00:55:12.248Z",title:"デイドリーム \u002F ぽんず",category:[],release:l,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fc546eb189c50472d80a4149b3399adcf\u002Fdaydream_b2.jpg",height:p,width:q},overview:"ぽんずさん1stアルバム「Pondentity」収録曲、デイドリームの映像を担当させていただきました。\n\n撮りためていた日常風景を歌詞に当てて編集しました。冒頭のイントロでは、抽象的でフックのあるイメージが欲しかったため水槽に水を張りインクを垂らしたイメージを再生・逆再生して使っています。",textlink1:"https:\u002F\u002Fwww.youtube.com\u002Fwatch?v=Sn8jnM6LBaM"},{id:"deer-mugcup",createdAt:e,updatedAt:"2022-01-09T01:05:08.725Z",publishedAt:e,revisedAt:e,title:"Deer \u002F MUG CUP",category:[],release:a,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Ffbada11c4a204d1188e104cee5003247\u002Fmugcup_b-800x500.jpg",height:m,width:n},overview:"オリジナルマグカップのデザインを制作しました。\n\n夏らしく涼しげな色合いを意識したデザインに仕上がりました。"},{id:"yamiagari-web",createdAt:f,updatedAt:"2022-01-09T01:05:12.002Z",publishedAt:f,revisedAt:f,title:"ヤミアガリ \u002F WEB SITE",category:[],release:a,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F2c7a661cf99a4f07b7ffb8843d3ec8f8\u002Fyamiagari_1-1.jpg",height:b,width:c},overview:"島根出身東京で活動を続ける男女2人組ユニットヤミアガリさんのウェブサイト、アーティスト写真のアートワークを制作させていただきました。\n\nヤミアガリさんの音から受ける「エレクトロニック」と「ダーク」をキーワードに黒をベースにさりげなく幾何学模様を取り入れたデザインに仕上がりました。\n\nスマホ・タブレットに対応したレスポンシブWebデザインで構築しました。",textlink1:r},{id:"yamiagari-logo",createdAt:g,updatedAt:"2022-01-09T01:05:16.038Z",publishedAt:g,revisedAt:g,title:"ヤミアガリ \u002F LOGO DESIGN",category:[],release:a,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F696956d6004f4a79b5dbe23b29c5eb63\u002Fyamiagarilogo_1.jpg",height:b,width:c},overview:"島根出身東京で活動を続ける男女2人組ユニットヤミアガリさんのロゴを制作させていただきました。\n\n幾何学やさまざまな形を組み合わせて遊びがあり、ヤミアガリさんの世界観に合わせたクールなデザインに仕上がりました。",textlink1:r},{id:"monochrome-morningglow-hello-dunce",createdAt:h,updatedAt:"2022-01-09T01:05:18.338Z",publishedAt:h,revisedAt:h,title:"「モノクローム\u002F朝焼け」 \u002F HELLO DUNCE",category:[],release:a,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F5032048a86ad43c7a042dd5e7e6eda58\u002Fhellodunce_3.jpg",height:b,width:c},overview:"HELLO DUNCEさんの1st single「モノクローム\u002F朝焼け」のアートワーク、ジャケットデザインを担当させていただきました。\n\nHELLO DUNCEさんの音から受ける「都会的」、「幻想的」、「モノクローム」をキーワードにコラージュで都会の朝をイメージしたアートワークを制作しました。"},{id:"i-will-mukaibi",createdAt:i,updatedAt:"2022-01-09T01:56:18.441Z",publishedAt:i,revisedAt:i,title:"I will \u002F MUKAIBI",category:[],release:a,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F21d420483d9f40fa802abc714c50ae7a\u002Fi_will_b2.jpg",height:p,width:q},overview:"MUKAIBI名義第二弾の曲は「I was」という過去に作った曲を別の視点でリメイクし、朝をイメージして作った曲です。ニコニコ動画、Youtube用の映像と音楽を制作しました。",textlink1:"https:\u002F\u002Fwww.youtube.com\u002Fwatch?v=bVrLo66xwqE"},{id:"fancynumnum-web",createdAt:s,updatedAt:"2022-01-09T01:56:22.151Z",publishedAt:s,revisedAt:"2022-01-09T01:35:41.720Z",title:"fancy numnum \u002F WEB SITE",category:[],release:"2013-05-31T15:00:00.000Z",thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002Fb2f47db185fc4f3191d8da113fe8ac91\u002Ffancynumnum_b2.jpg",height:b,width:c},overview:"スリーピースバンドfancy numnumさんのウェブサイトを制作させていただきました。\n\nfancy numnumさんの音から受ける幻想的なイメージをキーワードに縦長1ページにまとめたデザインに仕上がりました。\n\nスマホ・タブレットに対応したレスポンシブWebデザインで構築しました。",textlink1:"https:\u002F\u002Ftwitter.com\u002Ffancy_numnum"},{id:"hell-of-defense",createdAt:j,updatedAt:"2022-01-09T01:56:26.018Z",publishedAt:j,revisedAt:j,title:"地獄の守(も)り",category:[],release:t,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F8f3655fcceb049368b0334ffc77939ff\u002Fzigokunomamori_b2.jpg",height:475,width:765},overview:"尾上龍太郎監督地獄映画第２弾！「地獄の守(も)り」の音楽を制作させていただきました。宇宙を駆けめぐる桃三郎のSF冒険活劇！第３弾！「宇宙トラック野郎～ガニメデからの脱出」も同時投稿されてます。"},{id:"sengokumc-flyer",createdAt:k,updatedAt:"2022-01-09T01:56:29.036Z",publishedAt:k,revisedAt:k,title:"戦極MCBATTLE \u002F FLYER DESIGN",category:[],release:t,thumbnail:{url:"https:\u002F\u002Fimages.microcms-assets.io\u002Fassets\u002F8f9b212cd3634f1a9343ab4f3011eaa6\u002F9c651a7de99e4a66a062a081ed33a99e\u002Fsengoku_flyer_b2.jpg",height:b,width:c},overview:"戦極MCBATTLEさんの第五章新春ALL STAR GAMEのフライヤーを制作させていただきました。",textlink1:"https:\u002F\u002Fsengokumc.exblog.jp\u002F"}],totalCount:66,offset:50,limit:10},page:"6",pager:[0,1,2,3,4,5,6]}],fetch:{},mutations:void 0}}("2013-07-31T15:00:00.000Z",670,1080,"2022-01-09T00:42:44.186Z","2022-01-09T00:47:59.326Z","2022-01-09T00:49:16.461Z","2022-01-09T00:50:21.020Z","2022-01-09T00:52:40.437Z","2022-01-09T01:24:22.444Z","2022-01-09T01:27:51.767Z","2022-01-09T01:29:16.555Z","2013-08-31T15:00:00.000Z",500,800,"2022-01-09T00:44:05.420Z",434,700,"http:\u002F\u002Fyamiagari.net\u002F","2022-01-09T01:25:38.147Z","2013-04-30T15:00:00.000Z")));